const ramens = [
    { id: 1, name: "Shoyu Ramen", restaurant: "Ichiran", image: "data:image/jpeg;base64,", rating: 5, comment: "Delicious!" },
    { id: 2, name: "Miso Ramen", restaurant: "Menya", image: "data:image/jpeg;base64,", rating: 4, comment: "Very flavorful!" },
    { id: 3, name: "Tonkotsu Ramen", restaurant: "Ramen-ya", image: "data:image/jpeg;base64," }
];
function displayRamens() {
    const ramenMenu = document.getElementById('ramen-menu');
    ramenMenu.innerHTML = '';
    ramens.forEach(ramen => {
        const img = document.createElement('img');
        img.src = ramen.image;
        img.alt = ramen.name;
        img.classList.add('ramen-image');
        img.addEventListener('click', () => handleClick(ramen));

        ramenMenu.appendChild(img);
    });
}
function handleClick(ramen) {
    document.getElementById('detail-img').src = ramen.image;
    document.getElementById('ramen-name').textContent = ramen.name;
    document.getElementById('ramen-restaurant').textContent = ramen.restaurant;
    document.getElementById('ramen-rating').textContent = ramen.rating ? ramen.rating : 'N/A';
    document.getElementById('ramen-comment').textContent = ramen.comment ? ramen.comment : 'N/A';
}
function addSubmitListener() {
    const form = document.getElementById('new-ramen-form');
    form.addEventListener('submit', (event) => {
        event.preventDefault();
        const name = document.getElementById('name').value;
        const restaurant = document.getElementById('restaurant').value;
        const image = document.getElementById('image').value;
        const rating = document.getElementById('rating').value;
        const comment = document.getElementById('comment').value;
        const newRamen = {
            id: ramens.length + 1,
            name: name,
            restaurant: restaurant,
            image: image,
            rating: rating,
            comment: comment
        };
        ramens.push(newRamen);
        displayRamens();
        form.reset();
    });
}
function main() {
    displayRamens(); 
    addSubmitListener();
}
document.addEventListener('DOMContentLoaded', main);
